import React from "react";
import Layout from "./Layout";
import Signin from "./Signin";
function Home() {
  return (
    <div>
      <Layout />
      <div className="row " style={{ backgroundColor: "#379683" }}>
        <div className="col-md-6 custom-homepage-backgroundImage"></div>
        <div className="col-md-6">
          {" "}
          <Signin />{" "}
        </div>
      </div>
      <div className="row " style={{ backgroundColor: "#5CDB95" }}>
        <div className="col"></div>
        <div className="col-md-6 custom-homepage-backgroundImage-2"></div>
        <div className="col">
          <h1 style={{ color: "EDF5E1" }}> </h1>
        </div>
      </div>
    </div>
  );
}

export default Home;
